queries.query:
A=fetch('jvm.process.cpu.nanos', rate='counter', dropcounterresets='true', align="15s").downsample('[[__interval]]', 'p95');
nanos=1000000000;
cpu_pct=A.div(nanos).max(by='cloud_service');
output(cpu_pct);

